class User extends Component
{
    constructor()
    {
        super()
        this.state= {
            name: 'abc'
        }
    }

    componentDidMount() 
    {
        this.setState({name: 'xyz'})
        console.log('componentDidMount')
    }

    render()
    {
        console.log('render')
        return(
            <div>
                <h1>React</h1>
                <p>{this.state.name}</p>
            </div>
        )
    }
}

export default User
